import styled from 'styled-components';
import EmojiPicker from 'emoji-picker-react';

export const EmojisContainer = styled.div`
width: 100%;
max-height: 100%;
overflow: auto;
background-color: #fff;
`;

export const EmojiPickerContainer = styled(EmojiPicker)`
`;
